// Función para medir el tiempo de ejecucion
template <typename Func, typename... Args>
void measure_execution_time(Func func, Args&&... args) {
    auto start = high_resolution_clock::now(); // Inicia el temporizador
    func(forward<Args>(args)...); // Llama a la función de ordenación con sus argumentos
    auto end = high_resolution_clock::now();   // Finaliza el temporizador
    auto duration = duration_cast<microseconds>(end - start); // Calcula el tiempo transcurrido
    cout << "Tiempo de ejecucion: " << duration.count() << " microsegundos." << endl;
}

